import React from 'react';
import { Phone } from 'lucide-react';

const WehoNavbar = () => {
  return (
    <nav className="w-full bg-white shadow-md px-4 py-2">
      <div className="container mx-auto flex justify-between items-center">
        {/* Logo Container */}
        <div className="flex items-center">
          {/* Double Arrow Icon */}
          <div className="text-blue-600 mr-2">
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M8 4l8 8-8 8" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
              <path d="M2 4l8 8-8 8" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
          </div>
          {/* Text Logo */}
          <div className="flex items-center">
            <span className="text-blue-600 font-bold text-xl">WEHO</span>
            <span className="text-gray-600 font-bold text-xl ml-2">COURIER</span>
          </div>
        </div>

        {/* Phone Number */}
        <div className="flex items-center">
          <Phone className="text-blue-600 mr-2" size={20} />
          <span className="text-gray-700 font-semibold">Call (562) 810-2660</span>
        </div>
      </div>
    </nav>
  );
};

export default WehoNavbar;
